import React,{useState } from "react";
function Reducer(){
    const [value,setValue]=useState(0)
    const [test,setTest]=useState(0)
    return(
        <div>
        value :
            <button onClick={()=>setValue(value+1)}>+</button>
            <button onClick={()=>setValue(value-1)}>-</button>
            <button onClick={()=>setTest(test+1)}>test</button>
        </div>
    )
};
export default Reducer
